// ImageTextGrid.jsx
import React from 'react';
import './ImageTextGrid.css'; // Import your CSS file

const ImageTextGrid = () => {
    return (
        <div className="grid-container">
            <div className="grid-item">
                <img src="path/to/image1.jpg" alt="Description 1" className="grid-image" />
                <p>Text for Column 1</p>
            </div>
            <div className="grid-item">
                <img src="path/to/image2.jpg" alt="Description 2" className="grid-image" />
                <p>Text for Column 2</p>
            </div>
            <div className="grid-item">
                <img src="path/to/image3.jpg" alt="Description 3" className="grid-image" />
                <p>Text for Column 3</p>
            </div>
            <div className="grid-item">
                <img src="path/to/image4.jpg" alt="Description 4" className="grid-image" />
                <p>Text for Column 4</p>
            </div>
        </div>
    );
};

export default ImageTextGrid;
